// src/pages/FlightsPage.tsx
import React, { useState } from "react";
import Navbar from "../components/Navbar";

interface SearchParams {
  from: string;
  to: string;
  departDate: string;
  returnDate?: string;
  passengers: number;
}

const FlightsPage = () => {
  const [searchParams, setSearchParams] = useState<SearchParams>({
    from: "",
    to: "",
    departDate: "",
    returnDate: "",
    passengers: 1,
  });

  const [errors, setErrors] = useState<{ [key: string]: string }>({});

  const validate = () => {
    const newErrors: { [key: string]: string } = {};
    if (!searchParams.from.trim()) newErrors.from = "Introduceți orașul de plecare";
    if (!searchParams.to.trim()) newErrors.to = "Introduceți destinația";
    if (!searchParams.departDate) newErrors.departDate = "Selectați data plecării";
    if (searchParams.returnDate && searchParams.returnDate < searchParams.departDate)
      newErrors.returnDate = "Data întoarcerii nu poate fi mai devreme decât data plecării";
    if (searchParams.passengers < 1) newErrors.passengers = "Trebuie să existe cel puțin un pasager";
    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    const { name, value } = e.target;
    setSearchParams(prev => ({
      ...prev,
      [name]: name === "passengers" ? parseInt(value) : value,
    }));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    if (validate()) {
      console.log("Căutare inițiată:", searchParams);
      // Integrare API aici
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-50 to-white flex flex-col">
      <Navbar />

      <main className="flex-grow flex flex-col items-center px-6 py-16">
        <div className="bg-white rounded-3xl p-10 shadow-2xl max-w-3xl w-full">
          <h1 className="text-5xl font-extrabold mb-10 text-center text-blue-900 drop-shadow-md">
            Caută un zbor
          </h1>

          <form onSubmit={handleSubmit} noValidate className="space-y-8">
            {/* From */}
            <div>
              <label htmlFor="from" className="block mb-2 font-semibold text-gray-700">
                De la
              </label>
              <input
                type="text"
                id="from"
                name="from"
                value={searchParams.from}
                onChange={handleChange}
                placeholder="Oraș de plecare"
                className={`w-full rounded-lg border px-4 py-3 focus:outline-none focus:ring-2 ${
                  errors.from ? "border-red-500 focus:ring-red-400" : "border-gray-300 focus:ring-blue-400"
                } transition`}
              />
              {errors.from && <p className="text-red-600 mt-1 text-sm">{errors.from}</p>}
            </div>

            {/* To */}
            <div>
              <label htmlFor="to" className="block mb-2 font-semibold text-gray-700">
                Către
              </label>
              <input
                type="text"
                id="to"
                name="to"
                value={searchParams.to}
                onChange={handleChange}
                placeholder="Destinație"
                className={`w-full rounded-lg border px-4 py-3 focus:outline-none focus:ring-2 ${
                  errors.to ? "border-red-500 focus:ring-red-400" : "border-gray-300 focus:ring-blue-400"
                } transition`}
              />
              {errors.to && <p className="text-red-600 mt-1 text-sm">{errors.to}</p>}
            </div>

            {/* Depart Date */}
            <div>
              <label htmlFor="departDate" className="block mb-2 font-semibold text-gray-700">
                Data plecării
              </label>
              <input
                type="date"
                id="departDate"
                name="departDate"
                value={searchParams.departDate}
                onChange={handleChange}
                className={`w-full rounded-lg border px-4 py-3 focus:outline-none focus:ring-2 ${
                  errors.departDate ? "border-red-500 focus:ring-red-400" : "border-gray-300 focus:ring-blue-400"
                } transition`}
              />
              {errors.departDate && <p className="text-red-600 mt-1 text-sm">{errors.departDate}</p>}
            </div>

            {/* Return Date */}
            <div>
              <label htmlFor="returnDate" className="block mb-2 font-semibold text-gray-700">
                Data întoarcerii (opțional)
              </label>
              <input
                type="date"
                id="returnDate"
                name="returnDate"
                value={searchParams.returnDate}
                onChange={handleChange}
                className={`w-full rounded-lg border px-4 py-3 focus:outline-none focus:ring-2 ${
                  errors.returnDate ? "border-red-500 focus:ring-red-400" : "border-gray-300 focus:ring-blue-400"
                } transition`}
              />
              {errors.returnDate && <p className="text-red-600 mt-1 text-sm">{errors.returnDate}</p>}
            </div>

            {/* Passengers */}
            <div>
              <label htmlFor="passengers" className="block mb-2 font-semibold text-gray-700">
                Număr pasageri
              </label>
              <select
                id="passengers"
                name="passengers"
                value={searchParams.passengers}
                onChange={handleChange}
                className={`w-full rounded-lg border px-4 py-3 focus:outline-none focus:ring-2 ${
                  errors.passengers ? "border-red-500 focus:ring-red-400" : "border-gray-300 focus:ring-blue-400"
                } transition`}
              >
                {Array.from(Array(10).keys()).map(i => (
                  <option key={i + 1} value={i + 1}>
                    {i + 1}
                  </option>
                ))}
              </select>
              {errors.passengers && <p className="text-red-600 mt-1 text-sm">{errors.passengers}</p>}
            </div>

            {/* Submit Button */}
            <button
              type="submit"
              className="w-full bg-blue-600 hover:bg-blue-700 text-white font-bold py-4 rounded-lg shadow-lg transition"
            >
              Caută zboruri
            </button>
          </form>
        </div>

        <footer className="mt-12 text-center text-gray-500 text-sm select-none">
          © 2025 DevNebula. Toate drepturile rezervate.
        </footer>
      </main>
    </div>
  );
};

export default FlightsPage;
